import React from 'react';
import Navbar from './components/Navbar'

import {
  BrowserRouter as Router,
  Switch,
  Route
} from 'react-router-dom';

function App() {
  return (
    <Router>
      <Navbar />

      <Switch>
        <div className="container my-4">

          <Route path="/">
            <h1>Home</h1>
          </Route>

          <Route exact path="/addTeam">
            <h1>Add team</h1>
          </Route>

          <Route exact path="/addMatch">
            <h1>Add match</h1>
          </Route>

        </div>
      </Switch>

    </Router>
  );
}

export default App;
